import styled from "styled-components";

export const NavBar = styled.nav`
  position: fixed;
  display: flex;
  justify-content: space-between;
  align-items: center;
  flex: 1 0 100%;
  background-color: black;
  width: 100vw;
  padding: 0;
`;
export const Logo = styled.img`
  justify-content: center;
`;
